import { React } from "react";
function Card({ details }) {
  const { title, url } = details;
  console.log(details);
  return (
    <div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignContent: "center",
          border: "1px solid",
          borderRadius: "20px",
          margin: "20px",
        }}
      >
        <h1>{title}</h1>
        <img
          src={url}
          style={{ width: "800px", height: "500px", margin: "20px" }}
        />
      </div>
    </div>
  );
}

export default Card;
